import Link from 'next/link';

const Index = () => (
    <div>
        <ul>
            <li><Link href="/"><a>Home</a></Link></li>
            <li><Link href="/pin"><a>Pin</a></Link></li>
        </ul>

        <h1> Welcome to IPXS</h1>
    </div>
);

export default Index;
